        function adicionaExperimento(){
            var caminhoController = 'https://cad.bb.com.br/lib/apps/experimentos_teste/controller/controller_experimentos.php';
            $.ajax({
                aSync: true,
                url: caminhoController,
                data: {
                    request: 'adicionaExperimento'
                },
                type: "POST",
                dataType: "JSON",
                dataSrc: "",
                success: function(retorno) {
                    if (retorno.status == 1) {
                        bootbox.dialog({
                            className: 'limitaAltura',
                            backdrop: true,
                            onEscape: function() {},
                            // closeButton: true,
                            size: 'large',
                            title: "Adicionar novo experimento",
                            message: retorno.mensagem
                        });

                    } else {
                        // Se nÃ£o conseguir pesquisar, exibe a mensagem de erro
                        bootbox.dialog({
                            backdrop: true,
                            onEscape: function() {},
                            closeButton: true,
                            size: 'medium',
                            title: "Erro!",
                            message: "<div>"+retorno.mensagem+"</div>",
                            buttons: {
                                confirm: {
                                    label: 'Fechar',
                                    className: 'btn-danger',
                                }
                            }
                        });
                    }
                },
                error: function(erro) {
                    alert("NÃ£o foi possÃ­vel efetuar a operaÃ§Ã£o, por favor tente novamente. L47 - experimentos.php");
                }
            });
        }
    
